import React, { useEffect, useState } from 'react';
import { Container, Card } from 'react-bootstrap';
import appServices from '../../services/appServices';
import './final_project.css';

const Final_Project = () => {
    const [dataFinal, setData] = useState([]);
    useEffect(() => {
        appServices.getAllData().then((result) => {
            setData(result.data);
        });
    }, []);

    return (
        <div className="finalBody">
            <h1>OUR PROUD PROJECT</h1>
            <Container>
                <div>
                    <input className="search" type="text" placeholder="Search"></input>
                </div>
                <Card className="cardData" style={{width:'100%', height:'100%', color:'black'}}>
                    <Card.Body className="cardBody">
                        <div className="row" align="left">
                            <div>
                                <table>
                                    <tr>
                                        <th width="5%">No</th>
                                        <th width="60%">Title</th>
                                        <th width="40%">Author</th>
                                        <th width="30%">Year</th>
                                    </tr>
                                    {dataFinal.map((data) => {
                                        return (
                                            <tr>
                                                <td></td>
                                                <td>{data.title}</td>
                                                <td>{data.author}</td>
                                                <td>{data.year}</td>
                                            </tr>
                                        )
                                    })}
                                </table>
                            </div>
                        </div>
                    </Card.Body>
                </Card>
            </Container>
        </div>
    )
}

export default Final_Project;
